INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 8, 27, "人助けが大好き！　前向き格闘娘", "A", "ヒヨリ", "獣人族", 44, 155, "東山奈央", 2, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 16, "トゥインクルウィッシュ", "人助け、応援", 100101);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 4, 5, "戦闘のサポートが得意な、心優しい少女", "O", "ユイ", "ヒューマン", 47, 158, "種田梨沙", 2, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 17, "トゥインクルウィッシュ", "料理、人間観察", 100201);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 1, 12, "クールで何事にも真っ直ぐな剣士", "B", "レイ", "魔族", 46, 163, "早見沙織", 2, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 18, "トゥインクルウィッシュ", "読書、乗馬、お茶", 100301);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 8, 10, "探検好きのイタズラっ子", "O", "ミソギ", "ヒューマン", 27, 128, "諸星すみれ", 5, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 9, "リトルリリカル", "いたずら、探検", 100401);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 11, 25, "ヒーローに憧れる騎士見習いの少女", "O", "マツリ", "獣人族", 40, 146, "下田麻美", 8, "？？？", 12, "王宮騎士団（NIGHTMARE）", "ヒーローごっこ", 100501);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 11, 22, "甘え上手なみんなの人気者", "O", "アカリ", "魔族", 42, 150, "浅倉杏美", 7, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 13, "悪魔偽王国軍（ディアボロス）", "サックス", 100601);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 1, 23, "プリン大好きゴースト娘", "B", "ミヤコ", "魔族", 32, 130, "雨宮天", 7, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 14, "悪魔偽王国軍（ディアボロス）", "プリンを食べること", 100701);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 10, 10, "ボクは誰よりも美しい", "AB", "ユキ", "エルフ", 40, 150, "大空直美", 15, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 14, "ヴァイスフリューゲル　ランドソル支部", "鏡で自分を見ること", 100801);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 7, 5, "前世を信じる中二病患者、「疾風の冥姫」", "A", "アンナ", "魔族", 45, 159, "髙野麻美", 13, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 17, "トワイライトキャラバン", "小説執筆", 100901);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 9, 22, "マホマホ王国のプリンセス", "O", "マホ", "獣人族", 42, 155, "内田真礼", 10, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 16, "自警団（カォン）", "空想、ぬいぐるみ集め", 101001);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 8, 25, "人懐っこくてマシンガントークな妹系少女", "A", "リノ", "ヒューマン", 44, 156, "阿澄佳奈", 3, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 15, "ラビリンス", "お裁縫", 101101);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 12, 24, "みんなのために超能力を使う眠り姫", "A", "ハツネ", "エルフ", 46, 156, "大橋彩香", 6, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 17, "フォレスティエ", "妹と遊ぶこと、二度寝、昼寝、早寝", 101201);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 8, 21, "オタク全開な魔法少女", "O", "ナナカ", "魔族", 55, 166, "佳村はるか", 13, "", 18, "トワイライトキャラバン", "読書、魔法", 101301);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 11, 3, "頭脳明晰な美少女名探偵", "AB", "カスミ", "獣人族", 41, 152, "水瀬いのり", 10, "test", 15, "自警団（カォン）", "読書、推理", 101401);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 9, 5, "母性溢れる優しいみんなの「ミサト先生」", "O", "ミサト", "エルフ", 54, 165, "國府田マリ子", 6, "test", 21, "フォレスティエ", "絵本作り", 101501);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 4, 10, "天真爛漫で人気者のカリスマモデル", "O", "スズナ", "魔族", 48, 167, "上坂すみれ", 14, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 18, "ルーセント学院", "ファッション", 101601);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 7, 7, "いつでも「なんくるないさ～」な天然娘", "A", "カオリ", "獣人族", 53, 158, "高森奈津美", 10, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 19, "自警団（カォン）", "踊り、空手", 101701);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 8, 14, "多くの男性を魅了する無垢な女教師", "B", "イオ", "魔族", 52, 162, "伊藤静", 14, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 23, "ルーセント学院", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 101801);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 4, 3, "お歌もにんじんも、ウサギさんも大好き♪", "O", "ミミ", "獣人族", 21, 117, "日高里菜", 5, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 10, "リトルリリカル", "かわいいもの集め", 102001);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 6, 9, "泣き虫で臆病な守ってあげたい女の子", "B", "クルミ", "ヒューマン", 40, 150, "植田佳奈", 9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 12, "サレンディア救護院", "観劇、おままごと", 102101);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 11, 22, "人見知りであまのじゃくな女の子", "O", "ヨリ", "魔族", 40, 150, "原紗友里", 7, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 13, "悪魔偽王国軍（ディアボロス）", "ゲーム全般", 102201);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 5, 10, "ぷうきちといつも一緒！", "B", "アヤネ", "ヒューマン", 38, 148, "芹澤優", 9, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 14, "サレンディア救護院", "屋内でできる遊び", 102301);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 12, 12, "お嬢さまのためにがんばるドジっ娘メイド", "O", "スズメ", "ヒューマン", 43, 154, "悠木碧", 9, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 15, "サレンディア救護院", "ご奉仕", 102501);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 1, 1, "遊びと睡眠が何より大事なぐうたら娘", "B", "リン", "獣人族", 42, 144, "小岩井ことり", 11, "test", 17, "牧場（エリザベスパーク）", "あんパン", 102601);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 7, 30, "運命の相手に一途すぎる乙女", "B", "エリコ", "魔族", 43, 154, "橋本ちなみ", 13, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 16, "トワイライトキャラバン", "実験、裁縫、料理", 102701);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 10, 4, "救護院を経営する優しい庶民派お嬢様", "A", "サレン", "エルフ", 43, 156, "堀江由衣", 9, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 17, "サレンディア救護院", "経営、お茶会", 102801);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 1, 24, "歌って踊れる大人気アイドル", "B", "ノゾミ", "ヒューマン", 40, 157, "日笠陽子", 4, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 17, "カルミナ", "舞台鑑賞、ダンス", 102901);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 8, 31, "トーゴクの神秘、オシエテクダサイ！", "O", "ニノン", "ヒューマン", 51, 163, "佐藤聡美", 15, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 16, "ヴァイスフリューゲル　ランドソル支部", "忍法開発", 103001);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 12, 22, "占いが得意な霊能少女", "AB", "シノブ", "魔族", 42, 157, "大坪由佳", 7, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 18, "悪魔偽王国軍（ディアボロス）", "占い", 103101);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 3, 12, "一人前の商人を目指すパワフルお嬢様", "AB", "アキノ", "ヒューマン", 45, 157, "松嵜麗", 12, "この私とともにいる限り、\nお金に不自由はさせませんわ！", 18, "メルクリウス財団", "慈善事業", 103201);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 3, 3, "みんなを笑顔にするお笑い牧場主", "B", "マヒル", "ヒューマン", 35, 142, "新田恵海", 11, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 20, "牧場（エリザベスパーク）", "漫才", 103301);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 3, 16, "純情でほっとけない大人の女性", "A", "ユカリ", "エルフ", 55, 164, "今井麻美", 12, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 22, "メルクリウス財団", "ウインドーショッピング", 103401);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 2, 2, "礼儀正しくしっかり者のちびっ子優等生", "A", "キョウカ", "エルフ", 21, 118, "小倉唯", 5, "test", 8, "リトルリリカル", "お勉強", 103601);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 8, 11, "義理堅くてからかい好きな剣術少女", "A", "トモ", "ヒューマン", 43, 149, "茅原実里", 8, "test", 13, "王宮騎士団（NIGHTMARE）", "剣術、年長者をからかう", 103701);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 11, 3, "読書が趣味の病弱少女", "A", "シオリ", "獣人族", 40, 153, "小清水亜美", 11, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 14, "牧場（エリザベスパーク）", "読書、お散歩", 103801);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 6, 6, "「友達」に憧れる、エルフの森の女の子", "AB", "アオイ", "エルフ", 44, 158, "花澤香菜", 6, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 13, "フォレスティエ", "友達作りのイメトレ", 104001);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 6, 3, "人々を守るために歌う、唱喚士の少女", "O", "チカ", "ヒューマン", 46, 163, "福原綾香", 4, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 17, "カルミナ", "各種楽器", 104201);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 8, 9, "男勝りで情に厚いワイルド娘", "O", "マコト", "獣人族", 54, 168, "小松未可子", 10, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 17, "自警団（カォン）", "お菓子作り", 104301);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 5, 5, "かつては夜を支配した最強の吸血鬼", "A", "イリヤ", "魔族", 50, 172, "丹下桜", 7, "test", "??", "悪魔偽王国軍（ディアボロス）", "世界征服", 104401);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 11, 19, "妄想大好き！　ほんとは照れ屋な女の子", "AB", "クウカ", "ヒューマン", 49, 157, "長妻樹里", 15, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 18, "ヴァイスフリューゲル　ランドソル支部", "小説を読むこと", 104501);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 3, 1, "弱きを助け強きをくじく猫娘", "AB", "タマキ", "獣人族", 48, 158, "沼倉愛美", 12, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 18, "メルクリウス財団", "猫とたわむれること", 104601);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 10, 25, "素顔を見せない冷静沈着な女性騎士", "A", "ジュン", "ヒューマン", 50, 171, "川澄綾子", 8, "？？？", 25, "王宮騎士団（NIGHTMARE）", "格闘技、湯浴み", 104701);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 11, 11, "仕事も私事も効率優先な傭兵少女", "O", "ミフユ", "ヒューマン", 49, 163, "田所あずさ", 12, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 20, "メルクリウス財団", "傭兵などのアルバイト", 104801);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 10, 24, "お姉ちゃんがお世話してあげるからねっ！", "O", "シズル", "ヒューマン", 54, 168, "生天目仁美", 3, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 18, "ラビリンス", "家事全般", 104901);
