INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 3, 7, "実験が趣味の危険な科学者", "A", "ミツキ", "ヒューマン", 53, 166, "三石琴乃", 13, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 27, "トワイライトキャラバン", "研究、実験", 105101);
