INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 1, 3, "ちょっとおませな恋に恋する女の子", "A", "ミサキ（ハロウィン）", "魔族", 22, 120, "久野美咲", 14, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 11, "ルーセント学院", "ファッション誌鑑賞、コスメ集め", 108301);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 6, 3, "人々を守るために歌う、唱喚士の少女", "O", "チカ（クリスマス）", "ヒューマン", 46, 163, "福原綾香", 4, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 17, "カルミナ", "各種楽器", 108401);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 6, 9, "泣き虫で臆病な守ってあげたい女の子", "B", "クルミ（クリスマス）", "ヒューマン", 40, 150, "植田佳奈", 9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 12, "サレンディア救護院", "観劇、おままごと", 108501);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 5, 10, "ぷうきちといつも一緒！", "B", "アヤネ（クリスマス）", "ヒューマン", 38, 148, "芹澤優", 9, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 14, "サレンディア救護院", "屋内でできる遊び", 108601);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 8, 27, "人助けが大好き！　前向き格闘娘", "A", "ヒヨリ（ニューイヤー）", "獣人族", 44, 155, "東山奈央", 2, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 16, "トゥインクルウィッシュ", "人助け、応援", 108701);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 4, 5, "戦闘のサポートが得意な、心優しい少女", "O", "ユイ（ニューイヤー）", "ヒューマン", 47, 158, "種田梨沙", 2, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 17, "トゥインクルウィッシュ", "料理、人間観察", 108801);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 1, 12, "クールで何事にも真っ直ぐな剣士", "B", "レイ（ニューイヤー）", "魔族", 46, 163, "早見沙織", 2, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 18, "トゥインクルウィッシュ", "読書、乗馬、お茶", 108901);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 7, 30, "運命の相手に一途すぎる乙女", "B", "エリコ（バレンタイン）", "魔族", 43, 154, "橋本ちなみ", 13, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 16, "トワイライトキャラバン", "実験、裁縫、料理", 109001);
