INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 12, 1, "英霊と契約を結んだマナリアの天才王女", "AB", "アン", "ヒューマン", 55, 156, "日笠陽子", "", "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", 17, "？？？", "読書", 109201);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (0, 2, 4, "マナリア魔法学院の新入生", "O", "ルゥ", "ヒューマン", 45, 144, "こやまきみこ", "", "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", 15, "？？？", "食べること、眠ること", 109301);
